CREATE VIEW cuis.v_direcciones_coordenadas AS
 SELECT DISTINCT dir.calle,
    dir.altura,
    coo.x_wgs84,
    coo.y_wgs84,
    edi.edificio_id,
    cui.cui,
    public.st_setsrid(public.st_makepoint((coo.x_wgs84)::double precision, (coo.y_wgs84)::double precision), 4326) AS geom
   FROM (((cuis.direcciones dir
     LEFT JOIN cuis.coordenadas coo ON ((dir.coordenadas_id = coo.id)))
     JOIN cuis.edificios_direcciones edi ON ((dir.id = edi.direccion_id)))
     JOIN cuis.edificios cui ON ((edi.edificio_id = cui.id)));


