--
-- TOC entry 314 (class 1259 OID 87078)
-- Name: v_padron_cui; Type: VIEW; Schema: cuis; Owner: postgres
--

CREATE VIEW cuis.v_padron_cui AS
 SELECT edi.cui,
    upper(edi.estado) AS estado,
    upper(edi.sector) AS sector,
        CASE
            WHEN (edi.gestionado = true) THEN 'SI'::text
            ELSE 'NO'::text
        END AS gestionado,
        CASE
            WHEN (pre.nombre IS NULL) THEN 'SIN PREDIO'::text
            ELSE pre.nombre
        END AS predio,
    ((dir.calle || ' '::text) || dir.altura) AS direccion_principal,
    upper(ubi.comuna) AS comuna,
    upper(ubi.barrio) AS barrio,
    ubi.codigo_postal,
    edi.x_gkba,
    edi.y_gkba,
    edi.x_wgs84,
    edi.y_wgs84
   FROM ((((cuis.edificios edi
     LEFT JOIN cuis.predios pre ON ((edi.predio_id = pre.id)))
     LEFT JOIN cuis.edificios_direcciones edd ON ((edi.id = edd.edificio_id)))
     LEFT JOIN cuis.direcciones dir ON ((edd.direccion_id = dir.id)))
     LEFT JOIN cuis.ubicacion_administrativa ubi ON ((dir.ubicacion_administrativa_id = ubi.id)))
  WHERE (edd.es_principal = true);


ALTER VIEW cuis.v_padron_cui OWNER TO postgres;

